description:
Ett ungt par med taskig ekonomi hittar en massa smutsiga pengar efter en skottlossning i deras hyreshus. Med hopp om en battre liv flyr de med pengarna vilket gor en korrupt agent rasande och han kommer inte att stoppa for nagot innan han far sina pengar tillbaka.....



Skadespelare:

